function substrCount(n, s) {
  let substrings = []
  let combos = []

  for (let i = 0; i < s.length; i++) {
    substrings.push(s[i])
    let substring = ""
    let successiveCount = 0
    if (s[i] === s[i+1]) {
      successiveCount++
      combos.push(s[i].repeat(successiveCount))
    }
    for (let x = s.length; x > 0; x--) {
      let substring = s.substring(i, x)
      if (isPalindrome(substring) && substring.length > 1 && !combos.includes(substring)
        && !combos.includes(substring)) {
        combos.push(substring)
        // console.log("substring: " + substring);
      }
    }
  }

  let combined = substrings.concat(combos)
  let removeNull = combined.filter( (a) => a != '')
  return removeNull.length
}

function isPalindrome(s) {
  let first = s[0]
  let different = 0
  if (s.length > 1 && s.split('').reverse().join('') === s) {
    // return s.split('').reverse().join('') === s
    for (let i = 0; i < s.length; i++) {
      if (first !== s[i]) {
        different++
      }
    }
    // console.log(s);
    // console.log(different);
    if (different > 1) {
      return false
    } else {
      return true
    }
  } else {
    return false
  }
}

console.log(substrCount(8, "mnonopoo"));
console.log(substrCount(5, "asasd"));
console.log(substrCount(7, "abcbaba"));
console.log(substrCount(4, "aaaa"));
console.log(substrCount(4, ""));
